import logo from './logo.svg';
import './App.css';


var nome = 'Claudinho';
var idade = 19;


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Olá! Meu nome é {nome}!<br/>
          Eu tenho {idade} anos!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
